import Button from "@material-ui/core/Button";

import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div>
        <Button variant="outlined" color="secondary">
          Primary
        </Button>
      </div>
    );
  }
}

export default Home;
